`,paraId:14,tocIndex:6},{value:"Sort query results by the ",paraId:15,tocIndex:7},{value:"sort",paraId:15,tocIndex:7},{value:" parameter.",paraId:15,tocIndex:7},{value:`// SELECT * FROM users ORDER BY age
